function MontarGraficoLinhasGanhos(n){$.ajax({url:"/Dashboard/DadosGraficoGanhos",method:"GET",data:{ano:n},success:function(n){new Chart(document.getElementById("GraficoValoresGanhosDespesas"),{type:"line",data:{labels:PegarMeses(n),datasets:[{label:"Ganhos com pagamentos por ano",data:PegarValores(n),backgroundColor:"#90caf9",borderColor:"#0277bd",fill:!0,lineTension:0}]},options:{legend:{labels:{usePointStyle:!0}},scales:{xAxes:[{gridLines:{display:!1}}]}}})}})}function MontarGraficoLinhasDespesas(n){$.ajax({url:"/Dashboard/DadosGraficoDespesas",method:"GET",data:{ano:n},success:function(n){new Chart(document.getElementById("GraficoValoresGanhosDespesas"),{type:"line",data:{labels:PegarMeses(n),datasets:[{label:"Despesas com servi√ßos por ano",data:PegarValores(n),backgroundColor:"#ffcdd2",borderColor:"#b71c1c",fill:!0,lineTension:0}]},options:{legend:{labels:{usePointStyle:!0}},scales:{xAxes:[{gridLines:{display:!1}}]}}})}})}function MontarGraficoDespesasGanhosTotais(){$.ajax({url:"/Dashboard/DadosGraficoDespesasGanhosTotais",method:"GET",success:function(n){new Chart(document.getElementById("GraficoDespesasGanhosTotais"),{type:"pie",data:{labels:["Ganhos","Despesas"],datasets:[{label:"Total de ganhos e despesas",data:[n.ganhos,n.despesas],backgroundColor:["#0091ea","#c62828"]}]},options:{legend:{labels:{usePointStyle:!0}}}})}})}function PegarMeses(n){for(var i=[],r=n.length,t=0;t<r;)i.push(n[t].meses),t=t+1;return i}function PegarValores(n){for(var i=[],r=n.length,t=0;t<r;)i.push(n[t].valores),t=t+1;return i}